export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:c,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:c,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:c,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:c,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:10}}},ASYlrnuxou:{data:{id:464,attributes:{imdbId:"tt1478839",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZjU5ZTYzM2MtNDNhYi00YjU1LWE4MzEtODc0NmNlODZlMjlhXkEyXkFqcGdeQXVyNjg3MDMxNzU@._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"7.6\u002F10"},{Source:"Rotten Tomatoes",Value:"44%"},{Source:"Metacritic",Value:"43\u002F100"}],item_lang:{data:{id:1127,attributes:{title:d,plot:"Dog lovers believe their canine family members understand language, comprehend events, have opinions, exude loyalty. In \"The Art of Racing In The Rain\", wise old dog Enzo Swift shares thoughts about the life experiences which prepared him to protect his family in times of greatest need.",slug:"the-art-of-racing-in-the-rain"}}},books:{data:[{id:3648,attributes:{title:d,description:"Nearing the end of his life, Enzo, a dog with a philosopher's soul, tries to bring together the family, pulled apart by a three year custody battle between daughter Zoe's maternal grandparents and her father Denny, a race car driver.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=b0yFngEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:true,published:"2009-06-09",publisher:"Harper Paperbacks",subtitle:e}},{id:3649,attributes:{title:d,description:"A heart-wrenching but deeply funny and ultimately uplifting story of family, love, loyalty, and hope—a captivating look at the wonders and absurdities of human life . . . as only a dog could tell it.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=orqengEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:f,published:"2014-09-16",publisher:"Harper Perennial",subtitle:e}},{id:3650,attributes:{title:d,description:"NOW A MAJOR MOTION PICTURE FROM FOX 2000 STARRING MILO VENTIMIGLIA, AMANDA SEYFRIED, AND KEVIN COSTNER MEET THE DOG WHO WILL SHOW THE WORLD HOW TO BE HUMAN The New York Times bestselling novel from Garth Stein—a heart-wrenching but deeply funny and ultimately uplifting story of family, love, loyalty, and hope—a captivating look at the wonders and absurdities of human life . . . as only a dog could tell it. “Splendid.” —People “The perfect book for anyone who knows that compassion isn’t only for humans, and that the relationship between two souls who are meant for each other never really comes to an end. Every now and then I’m lucky enough to read a novel I can’t stop thinking about: this is one of them.” —Jodi Picoult “It’s impossible not to love Enzo.” —Minneapolis Star Tribune “This old soul of a dog has much to teach us about being human. I loved this book.” —Sara Gruen",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=s8zIH7dnYCsC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:f,published:"2009-03-17",publisher:h,subtitle:e}},{id:3651,attributes:{title:"The Art of Racing in the Rain Movie Tie-in Edition",description:"New York Times Bestseller A beautifully crafted and captivating look at the wonders and absurdities of human life...as only a dog could tell it—now a major motion picture from Fox 2000 starring Milo Ventimiglia, Amanda Seyfried, and Kevin Costner. “The Art of Racing in The Rain has everything: love, tragedy, redemption, danger, and—most especially—the canine narrator Enzo. This old soul of a dog has much to teach us about being human. I loved this book.”—Sara Gruen, Author of Water for Elephants The Art of Racing in the Rain—the blockbuster New York Times bestselling novel—is now a major motion picture from Fox 2000, with a screenplay by Mark Bomback, starring Milo Ventimiglia as Denny, Amanda Seyfried as Eve, and Kevin Costner as the voice of Enzo, with Simon Curtis (Goodbye Christopher Robin) directing. Enzo is a very special dog who takes stock of his life on the eve of his death. As he recalls all that he and his family have been through: the sacrifices his master, Denny Swift—an up-and-coming race car driver—has made to succeed professionally; the unexpected loss of Eve, Denny's wife; the three-year battle over their daughter, Zoë, whose maternal grandparents pulled every string to gain custody. In the end, Enzo comes through heroically to preserve the Swift family, holding in his heart the dream that Denny will become a racing champion with Zoë at his side. Having gained tremendous insight into the human condition, Enzo discovers that the techniques needed on the racetrack can also be used to successfully navigate the journey of life.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=K70ZrgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:f,published:"2019-08-13",publisher:"Harper",subtitle:e}},{id:3652,attributes:{title:"Racing in the Rain",description:"Soon to be a family friendly major motion picture from Fox 2000 Studios—featuring Milo Ventimiglia, Amanda Seyfried, and Kevin Costner as the voice of Enzo the dog! In this young readers’ edition of the New York Times bestselling adult novel The Art of Racing in the Rain, meet one funny mutt—Enzo, the lovable dog who tells this story. Enzo knows he is different from other dogs. Most dogs love to chase cars, but Enzo longs to race them. He learns about racing and the world around him by watching TV and by listening to the words of his best friend, Denny, an up-and-coming race car driver, and Denny's daughter, Zoë, his constant companion. Enzo finds that life is just like being on the racetrack—it isn't simply about going fast. Applying the rules of racing to his world, Enzo takes on his family's challenges and emerges a hero. In the end, Enzo holds in his heart the dream that Denny will go on to be a racing champion with his daughter by his side. For theirs is an extraordinary friendship—one that reminds us all to celebrate the triumph of the human (and canine) spirit.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Zm6nXfYSO6wC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:f,published:"2011-05-03",publisher:h,subtitle:"My Life as a Dog"}}]}}},meta:{}}},prerenderedAt:1694069462562}}("movie","Garth Stein","series","The Art of Racing in the Rain","A Novel",null,1,"Harper Collins"))